import React from 'react';
import Slide1 from '../utils/Caurosel_img/slide-1.jpg';

function Home() {
  return (
    <div className='container'>
      <div className='card'>
          <div className='card_body'>
              <img src={Slide1}/>
              <h2 className='card_title'>Sengundhar Thirumana Mandapam</h2>
              <p className='card_description'>Located Opp to Murugan Kovil</p>
          </div>
          <button className='card_btn'>View Details</button>
      </div>
    </div>

  )
}

export default Home
